function changeImage() {
  var image = document.getElementById("myImage");
  if (image.src.endsWith("data:image/jpeg;base64,")) {
    image.src = "data:image/jpeg;base64,";
    image.alt = "Image 2";
  } else {
    image.src = "data:image/jpeg;base64,";
    image.alt = "Image 1";
  }
}

